import ReactDOM from "react-dom"



function App(){
   // const colors = [<h1>Green</h1>,<h1>Yellow</h1>,<h1>Blue</h1>]
     const colors = ["Green","Yellow","Blue"]
    
    return(
        <div>
            {colors}
        </div>
    )
}

ReactDOM.render(<App/>,document.getElementById("root"))
